import React, {Component}  from 'react';

import Topbar from "./Components/Topbar";
import logoImage from './Images/logo.jpg';


class HomePage extends Component {
  render() {
    return (
      <div>
        <Topbar />
        <div className = "Image">
        <img src = {logoImage} />
        </div>
      </div>
    )
  }
}

export default HomePage;
